import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../../images/navbar/logo.png';
import style from './navbar.module.css';

function Navbar() {
  return (
    <nav className={style.nav}>
      <img className={style.img} src={logo} alt='logo' width='100' lang='100' />
      <Link to='/userHome' className={style.link}>
        Home
      </Link>
      <Link to='/user' className={style.link}>
        User Data
      </Link>
      <Link to='/firstSteps' className={style.link}>
        First Steps
      </Link>
      <Link to='/assembly' className={style.link}>
        Assembly
      </Link>
      <Link to='/test' className={style.link}>
        Test Your Self
      </Link> 
      <Link to='/premium' className={style.link}>
        Premium
      </Link>
    </nav>
  );
}

export default Navbar;
